import * as React from 'react';
import Box from '@mui/material/Box';
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';

export default function ButtonUsage() {
  return (
    <div >
      <Box sx={{ textAlign: 'center' }}> {/* Aligns text and button to the center */}
        <Typography variant="h3" gutterBottom style={{ marginBottom: '10px' }}> {/* Moves heading closer to the button */}
          Click Button to Generate Menu of Next Week
        </Typography>
        <Button variant="contained" style={styles.button}>
          GENERATE
        </Button>
      </Box>
    </div>
  );
}

const styles = {
  container: {
    display: 'flex',
    justifyContent: 'center',  // Centers horizontally
    alignItems: 'flex-start',  // Aligns towards the top (not full vertical center)
    height: '20vh',           // Full viewport height
    paddingTop: '20vh',        // Adjust this to move elements closer to the top
  },
  button: {
    width: '200px',            // Button width
    height: '60px',            // Button height
    fontSize: '18px',          // Text size
  }
};
